from typing import List

class Solution:
    def shiftDistance(self, s: str, t: str, nextCost: List[int], previousCost: List[int]) -> int:
        def get_next(ch):
            yield 'a' if ch == 'z' else chr(ord(ch) + 1)
        def get_previous(ch):
            yield 'z' if ch == 'a' else chr(ord(ch) - 1)
        res = 0
        for x, y in zip(s, t):
            total_next, total_prev = 0, 0
            ch = x
            while ch != y:
                total_next += nextCost[ord(ch) - 97]
                ch = list(get_next(ch))[0]
            ch = x
            while ch != y:
                total_prev += previousCost[ord(ch) - 97]
                ch = list(get_previous(ch))[0]
            res += min(total_next, total_prev)
        return res

